<template>

    <div class="container">
        <div id="signup">
            <form>
                <h1 class="logo-text text-center mb-3 mb-md-5">LOGO</h1>
                <h3 class="text-center text-gray mb-3 mb-md-4">Sign Up</h3>
                <div class="form-group">
                    <label for="firstname"><span>First Name</span></label>
                    <input type="text" name="firstname" v-model.trim="$v.firstname.$model" class="form-control" id="firstname">
                    <div class="error" v-if="$v.firstname.$dirty && $v.firstname.$error && !$v.firstname.required">First Name is required</div>
                    <div class="error" v-if="$v.firstname.$dirty && $v.firstname.$error && !$v.firstname.minLength">First Name must have at least {{$v.firstname.$params.minLength.min}} letters.</div>
                </div>
                <div class="form-group">
                    <label for="lastname"><span>Last Name</span></label>
                    <input type="text" name="firstname" v-model.trim="$v.lastname.$model" class="form-control" id="lastname">
                    <div class="error" v-if="$v.lastname.$dirty && $v.lastname.$error && !$v.lastname.required">Last Name is required</div>
                    <div class="error" v-if="$v.lastname.$dirty && $v.lastname.$error && !$v.lastname.minLength">Last Name must have at least {{$v.lastname.$params.minLength.min}} letters.</div>
                </div>
                <div class="form-group">
                    <label for="username"><span>User Name</span></label>
                    <input type="text" name="firstname" v-model.trim="$v.username.$model" class="form-control" id="username">
                    <div class="error" v-if="$v.username.$dirty && $v.username.$error && !$v.username.required">Username is required</div>
                    <div class="error" v-if="$v.username.$dirty && $v.username.$error && !$v.username.minLength">Username must have at least {{$v.username.$params.minLength.min}} letters.</div>
                    <div class="error" v-if="$v.username.$dirty && $v.username.$error && !$v.username.alphaNum">Username must be Alpha Numeric.</div>
                </div>
                <div class="form-group">
                    <label for="email"><span>Email</span></label>
                    <input type="email" name="email" v-model.trim="$v.email.$model" class="form-control" id="email">
                    <div class="error" v-if="$v.email.$dirty && $v.email.$error && !$v.email.required">Email is required</div>
                    <div class="error" v-if="$v.email.$dirty && $v.email.$error && !$v.email.email">Pleasae enter valid email</div>
                </div>
                <div class="form-group">
                    <label><span>What kind of user you are?</span></label>
                    <el-select class="form-control" v-model="user_type"  placeholder="Select">
                        <el-option
                            v-for="item in UserOptions"
                            :key="item.value"
                            :label="item.label"
                            :value="item.value">
                        </el-option>
                    </el-select>
                    <div class="error" v-if="$v.user_type.$dirty && $v.user_type.$error && !$v.user_type.required">User Type is required</div>
                </div>

                <div class="form-group" v-if="user_type">
                    <label><span>Which game(s) do you play?</span></label>
                    <el-select class="form-control"
                        v-model="games"
                        multiple
                        filterable
                        remote
                        reserve-keyword
                        placeholder="Please enter game name"
                        :remote-method="remoteMethod"
                        :loading="loading">
                        <template slot="prefix"></template>
                        <!--<template slot="prefix"><img style=" width: 20px;height: 20px;" class="prefix" :src="value.photo" /></template>-->
                        <el-option
                            v-for="item in gameOptions"
                            :key="item.value"
                            :label="item.label"
                            :value="item.value">
                            <img style=" width: 40px;" class="img-fluid" :src="$servername +'/image/games/'+item.photo"> {{ item.label }}
                        </el-option>
                    </el-select>
                    <div class="error" v-if="$v.games.$dirty && $v.games.$error && !$v.games.required">Please Select at least one game.</div>
                    <div class="error" v-if="$v.games.$dirty && $v.games.$error && !$v.games.minLength">Please Select at least one game.</div>
                </div>


                <div class="form-group"  v-if="games" v-for="game,i in games">
                    <label><span>Select your level as a <b class="text-capitalize">{{getname(game)}} </b> player?</span></label>
                    <el-select class="form-control" v-model="level[i]"
                               :default-first-option="true"
                               placeholder="Select">
                        <el-option
                            v-for="item in LevelOptions"
                            :key="item.value"
                            :label="item.label"
                            :value="item.value">
                        </el-option>
                    </el-select>
                </div>
                <div class="form-group">
                    <label for="username"><span>Password</span></label>
                    <input type="password" v-model="password"  v-model.trim="$v.password.$model" class="form-control" id="password">
                    <div class="error" v-if="$v.password.$dirty && $v.password.$error && !$v.password.required">Password is required</div>
                </div>
                <div class="text-center text-warning clearfix mt-3">
                    <div v-if="isMessage">{{message}}</div>
                </div>
                <div class="text-center mt-2">
                    <button type="submit" @click="submitUser" class="btn btn-link"><b>Register</b></button>
                    <router-link to="/login" class="btn btn-link"><b>Login</b></router-link>
                </div>
            </form>
        </div>
    </div>
</template>

<script>
    import Drop from "vue-simple-uploader/src/components/drop";
    import { required, minLength, between,email,alphaNum } from 'vuelidate/lib/validators'
    export default {
        components: {Drop,required, minLength, between,email,alphaNum},
        name: "Signup",
        data() {
            return {
                level: [],
                gameOptions: [],
                games: [],
                list: [],
                loading: false,
                states: [
                    {
                        value: 'call-of-duty',
                        label: 'Call Of Duty',
                        photo: 'data:image/jpeg;base64,'

                    },{
                        value: 'league-of-legends',
                        label: 'League of Legends',
                        photo: 'https://esportsssm-dev.serverdatahost.com/img/league-of-legends.c77e2337.jpg'
                    },{
                        value: 'apex',
                        label: 'Apex',
                        photo: 'data:image/jpeg;base64,'
                    },{
                        value: 'pubg',
                        label: 'PUBG',
                        photo: 'data:image/jpeg;base64,'
                    },{
                        value: 'minecraft',
                        label: 'Minecraft',
                        photo: 'data:image/jpeg;base64,'
                    },{
                        value: 'fortnite',
                        label: 'Fortnite',
                        photo: 'data:image/jpeg;base64,'
                    },{
                        value: 'overwatch',
                        label: 'Overwatch',
                        photo: 'data:image/jpeg;base64,'
                    }
                    ],
                UserOptions: [{
                    value: 'player',
                    label: 'Player',
                    photo: 'https://upload.wikimedia.org/wikipedia/commons/5/50/McDonald%27s_SVG_logo.svg'
                }, {
                    value: 'team',
                    label: 'Team',
                    photo: 'https://upload.wikimedia.org/wikipedia/commons/5/50/McDonald%27s_SVG_logo.svg'
                }],
                LevelOptions: [{
                    value: 'casual',
                    label: 'Casual'
                }, {
                    value: 'tryhard',
                    label: 'Tryhard'
                }, {
                    value: 'amateur',
                    label: 'Amateur'
                }, {
                    value: 'Pro',
                    label: 'pro'
                }],
                user_type: '',


                firstname: "",
                lastname: "",
                username: "",
                email: "",
                password: "",
                message:"",
                isMessage:false
            };
        },
        validations: {
            firstname: {
                required,
                minLength: minLength(4)
            },
            lastname: {
                required,
                minLength: minLength(4)
            },
            username: {
                required,
                minLength: minLength(4),
                alphaNum:alphaNum
            },
            email: {
                required,
                email
            },
            user_type: {
                required
            },
            password: {
                required
            },
            games: {
                required,
                minLength: minLength(1),
            }

        },
        methods: {

            getname(game) {
                let obj = this.list.find(o => o._id === game.name);
                return obj.label;
            },
            submitUser(e) {
                e.preventDefault();
                this.$v.$touch()
                if (this.$v.$invalid) {
                    this.submitStatus = 'ERROR'
                } else {
                    this.isMessage=false;
                    var gameList = [];
                    this.games.forEach( function ( val, i ){
                        gameList.push({
                            game_id:val,
                            level:this.level[i]
                        })
                    },this)
                    const data = {

                        firstName: this.firstname,
                        lastName: this.lastname,
                        username: this.username,
                        email: this.email,
                        password: this.password,
                        user_type: this.user_type,
                        games: gameList
                    }
                    console.log(data);
                    this.axios.defaults.headers.post['Content-Type'] = 'application/x-www-form-urlencoded';
                    this.axios
                        .post(this.$servername + "/users/register", data)
                        .then(response => {
                            // console.log(response.data.length);
                            if (response.data.length !== 0) {
                                this.isMessage=true;
                                this.message = "Register successfully"
                                console.log("Register successfully");
                                this.firstname = "";
                                this.lastname = "";
                                this.username = "";
                                this.email = "";
                                this.password = "";
                                this.user_type = "";
                                this.user_type = "";
                                this.games = [];
                                this.level= [];
                                // this.$router.replace({ name: "admin_users" });
                            } else {
                                this.isMessage=true;
                                this.message = "Something went wrong try again!!"
                                console.log("Register faild");
                            }
                            return response.data;
                        })
                        .catch(error => {
                            this.isMessage=true;
                            this.message = "Something went wrong try again!!"
                            return error;
                        });
                }
            },
            remoteMethod(query) {
                if (query !== '') {
                    this.loading = true;
                    setTimeout(() => {
                        this.loading = false;
                        this.gameOptions = this.list.filter(item => {
                            return item.label.toLowerCase()
                                .indexOf(query.toLowerCase()) > -1;
                        });
                    }, 200);
                } else {
                    this.options = [];
                }
            }
        },
        mounted() {
            this.axios.get(this.$servername + "/games").then(response => {
                this.list = response.data.map(item => {
                       return { value: item.id, label: item.name, photo: item.image };
                   });
            });
        },
    };
</script>

